puzzle = """

""".strip()

def check_marker(puzzle):
    marker = puzzle[-14:]
    for char in marker:
        counts = marker.count(char)
        if counts > 1:
            return False
    return True
    
for total in range(len(puzzle)):
    if total > 13:
        if check_marker(puzzle[:total]):
            print(total)
            break
        
